import React, { Component } from 'react'
import HeroImg from '/Users/brandonjernigan/Desktop/Code/my-portfolio/src/img/b_bg.png';

export default class Hero extends Component {
  render() {
    return (
      <div>
        <section className="hero-section" data-section="hero">
        <div className="row">
            <div className="col-md-6">
              <div className="title-wrapper">
                <h1 className="main-h1">Brandon Jernigan</h1>
                <h2 className="label-h2">UX designer</h2>
              </div>
              </div>
              <div>
                <img className="hero-image" src={HeroImg} />
              </div>
            </div>
        </section>
      </div>
    )
  }
}
